import React, { Component } from 'react';


//Pages Imports
import Main from './pages/Main';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class App extends Component {
  render() {
    return (
      <Router>
      <div>
        <Header />
        <Switch>
          <Route path="/">
            <About />
          </Route>
          <Route path="/letter">
            <Users />
          </Route>
        </Switch>
      </div>
    </Router>
    );
  }
}

export default App;
